import React, { useState } from 'react';
import '../../App.css';

function TodoApp() {
    return (
        <div >
            <LoginComponent/>
        </div>

    )
}

function LoginComponent(props) {

    [userName, setUserName] = useState("jacky");
    [passWord, setPassWord] = useState("");

    const handleUserName = (e) => {
        setUserName(e.target.value);
    }

    const handlePassWord = (e) => {
        setPassWord(e.target.value);
    }

    return (
        <div>
            User Name: <input type="text" name="username" value={userName} onChange={handleUserName(e)}></input><br/>
            Password: <input type="password" name="password" value={passWord} onChange={handlePassWord(e)}></input><br/>
            <button>Login</button>
        </div>
    )
}

export default TodoApp;
